	jal IMAGE
	
	# ----- Esperar ------
	li a0, 0xffff
	jal wait
	
	# ---------------- Borrado Esttico de Click ---------------------
	mv a0,s0		# Coordenada X
	mv a1,s1		# Coordenada Y
	li a2, 40		# Ancho
	li a3, 10		# Alto
	li a4, 0		# Color
	jal RECTANGLE
	
	mv ra,s3		# Recuperar registro de retorno
	ret
	
	# Tag to make a gradient photo (Multicolor_Fill.asm)
	# Arguments:
	# a0: Pointer to Start
	# a1: Width
	# a2: Height
	
Gradient:
	
	li t0, NEGRO
	li t1, SIZE
	li t2, 0				# Contador
	li t5,0				# Contador de filas
	li t3,4				# Palabra
	sub t1,t1,a1			# (512-Ancho)
	mul t4,t1,t3			# Salto de Linea
	
bucle2:
	
	beq t2,a1, linea
	addi t0,t0,200		# Altera ligeramente un color
	sw t0, 0(a0)		# Colorea un pixel
	addi a0,a0,4		#Mueve de pixel
	addi t2,t2,1		# Aumenta el contador
	b bucle2			# Vuelve

linea:
	beq t5,a2, final
	li t2,0			# Reinicia contador
	addi t5,t5,1		# Aumenta el contador
	add a0,a0,t4		# Salta de linea
	b bucle2
	
final:
	ret

